import React, {useContext} from 'react'
import { useNavigate } from 'react-router'
import mainContext from '../context/mainContext'

const Toolbar = () => {

  const nav = useNavigate()
  const {socket, logedinUser, purchasedTickets} = useContext(mainContext) 




  return (
    <div className="toolbar">

      {logedinUser &&  (
        <>
        <div>
        <p>User name: {logedinUser.email}</p>
        <p>Money: {logedinUser.money}</p>
        <p>Age: {logedinUser.age}</p>
        </div>
        <div>
        <button onClick={() => nav("/allmovies")}>Movie list</button>
        <button onClick={() => nav("/mytickets")}>My tickets {purchasedTickets && `(${purchasedTickets.length.toFixed(2)})`}</button>
        </div>

        </>
      )}


    </div>
  )
}

export default Toolbar
